import { createStore, applyMiddleware } from 'redux';
import { composeWithDevTools } from 'redux-devtools-extension/developmentOnly'; // Import this from redux-devtools-extension

import reducers from './reducers/index.js';

const store = createStore(
  reducers,
  composeWithDevTools(applyMiddleware(window.__REDUX_DEVTOOLS_EXTENSION__ && window.__REDUX_DEVTOOLS_EXTENSION__()))
);

export default store;
